import React, { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import axios from 'axios';

const API_BASE_URL = process.env.REACT_APP_API_BASE_URL;

const StudentManagement = () => {
  const [email, setEmail] = useState('');
  const [name, setName] = useState('');
  const [nickname, setNickname] = useState('');
  const [birthDate, setBirthDate] = useState('');
  const [nationality, setNationality] = useState('');
  const [residence, setResidence] = useState('');
  const [zoomMeetingDate, setZoomMeetingDate] = useState('');
  const [registrationStatus, setRegistrationStatus] = useState('');
  const [freeClassTeacher, setFreeClassTeacher] = useState('');
  const [level, setLevel] = useState('');
  const [assignedClass, setAssignedClass] = useState('');
  const [scheduledStartDate, setScheduledStartDate] = useState('');
  const [discount, setDiscount] = useState('');
  const [availableTime, setAvailableTime] = useState('');
  const [memo, setMemo] = useState('');

  // 나머지 로직은 추후 작성
  // ...

  return (
    <div className="container">
      <h1 className="mt-3 mb-3">학생 관리</h1>
      <div className="mb-3 d-flex justify-content-between">
        <div>
          <button className="btn btn-primary">전체 신청자</button>
          <button className="btn btn-secondary ml-2">등록 학생</button>
          <button className="btn btn-secondary ml-2">재학생</button>
          <button className="btn btn-secondary ml-2">탈퇴 학생</button>
        </div>
        <button className="btn btn-success">학생 생성</button>
      </div>
      <table className="table">
        <thead>
          <tr>
            <th>신청일시</th>
            <th>이름</th>
            <th>애칭</th>
            <th>이메일</th>
            <th>생년월일</th>
            <th>국적</th>
            <th>거주국가</th>
            <th>줌 미팅 예정일시</th>
            <th>등록 상황</th>
            <th>무료 수업 강사</th>
            <th>레벨</th>
            <th>배정 클래스</th>
            <th>수업 시작 예정일</th>
            <th>할인</th>
            <th>수업 가능 시간</th>
            <th>메모</th>
          </tr>
        </thead>
        <tbody>
          {/* 여기에 학생 정보를 루프로 돌려서 넣으면 돼 */}
        </tbody>
      </table>
      <button className="btn btn-info">더 보기</button>
    </div>
  );
};

export default StudentManagement;
